function callModalAddService(n,t=""){return $.ajax({url:n,"async":!0,success:function(n){t!=""&&($("#modalContent").parent().hasClass(t)||$("#modalContent").parent().addClass(t));$("#modalContent").html(n);$("#modalContent").find("select").each(function(){$(this).select2({theme:"bootstrap4",width:"100%"})});$("#Ref_Service_Id").on("select2:select",function(){});$("#Priority_Id").on("select2:select",function(n){setDateRange(n.params.data.id)});$("#modalArea").modal("show")}}),!1}function callModalCommit(n,t){$.ajax({url:n,"async":!0,success:function(n){$("#modalContent").parent().hasClass("modal-lg")||$("#modalContent").parent().addClass("modal-lg");$("#modalContent").html(n);$("#modalContent").find("select").each(function(){$(this).select2({theme:"bootstrap4",width:"100%"})});$("#serviceRefList").load(t);$("#modalArea").modal("show")}})}function deleteFile(n,t){swal({title:"Are you sure?",text:"Once deleted, you will not be able to recover this file",icon:"warning",buttons:!0,dangerMode:!0}).then(i=>{if(i)return $.ajax({url:n,"async":!0,success:function(n){swal({title:n.title,text:n.text,icon:n.icon,button:n.button,dangerMode:n.dangerMode});n.icon=="success"&&$("#fileTable").load(t)}}),!1})}function setDateRange(n,t){$.ajax({url:n,data:{id:t},"async":!0,success:function(){var n=new Date;$("#Service_DueDate").attr("min","")}})}